import React from "react";
import { useParams } from "react-router-dom";
import productsData from "../Data/productsData";
import PageImages from "../Components/PageImages"

const Product = () => {
  const { productId } = useParams();
  const product = productsData.find(item => item.id === productId)
  const ProductImages = product.images;
  console.log(ProductImages.forEach(element => element.path))
  return (
    <div>
       {productsData.map((gallery) => (
         <div key={gallery.id}>
        <PageImages gallery={gallery} />
        </div>
      ))}
  <div>{product.producer}</div>
  <div>{product.name}</div>
  <div>{product.ratings}</div>
  <div>{product.price.amount} {product.price.currency}</div>
  </div>
  );
};

export default Product;
